import React, { useState } from "react";

const Effect = ()=>{

    const [num1, setNum1] = useState(0);
    const [num2, setNum2] = useState(0);

    return(
        <>
            <div>
                <button onClick={()=>{
                    setNum1(num1 + 1);
                }}> click {num1} </button>
                <br/>
                <button onClick={()=>{
                    setNum2(num2 + 1);
                }}> click {num2} </button>
            </div>
        </>
    );
}

export default Effect;
